import React from "react";
import { Container, Content } from "./styles";
import { FaUserAlt } from "react-icons/fa";
import bntmenuactive from "../../../assets/icon/bnt-menu-active.svg";

import SidebarItem from "../SidebarItem/Sidebaritem";
import SidebarButton1 from "../Sidebarbutton1";
import SidebarButton2 from "../Sidebarbutton2";

import { Link } from "react-router-dom";

const Sidebar = ({ active }) => {
  const closeSidebar = () => {
    active(false);
  };

  return (
    <Container sidebar={active}>
      <img src={bntmenuactive} onClick={closeSidebar} />
      <Content>
      <Link to="/FormCurso">
        <SidebarButton1 Text="Cadastro Curso">
        </SidebarButton1>
        </Link>
        <SidebarButton1 Text="Cadastro Periodo">
          <Link to="/FormPeriodo">Link Text</Link>
        </SidebarButton1>
        <SidebarButton1 Text="Cadastro Professor">
          <Link to="/FormProfessor">Link Text</Link>
        </SidebarButton1>
        <SidebarButton1 Text="Cadastro Sala">
          <Link to="/FormSala">Link Text</Link>
        </SidebarButton1>
        <SidebarButton1 Text="Cadastro Materias">
          <Link to="/FormMateria">Link Text</Link>
        </SidebarButton1>
        <SidebarButton1 Text="Cadastro Horarios">
          <Link to="/FormHorario">Link Text</Link>
        </SidebarButton1>
      </Content>
    </Container>
  );
};

export default Sidebar;
